import * as api from '../api/index.js';

export const register = (sellerInfo,router) =>  async(dispatch) => {
    try {
       const {data} = await api.registerSeller(sellerInfo)
       //console.log(data.result);
       dispatch({type: 'REGISTER', payload: data}); 

        //router.push('/customer');
    } catch (error) {
        console.log(error);
    }
};

export const fetchData = async (dispatch) => {
    try {
        const {data} = await api.fetchAllSeller();
        dispatch({type: "FETCH_ALL", payload: data});
    }
    catch (err) {
        console.log(err);
    }
}

export const Navbar_Solution_True = async (dispatch) => {

    try{
            dispatch({type: "OPEN"});
    }
    catch(err) {
        console.log(err);
    }
}

export const Navbar_Solution_False = async (dispatch) => {

    try{
            dispatch({type: "CLOSE"});
    }
    catch(err) {
        console.log(err);
    }
}

export const searchBy = (name,value) => async (dispatch) => {
    try {

            const data = {
                name: name,
                value : value
            }

            dispatch({type: 'SEARCH_BY', payload: data })
    }
    catch (err) {
        console.log(err);
    }
}
